import { Grid, Typography } from '@mui/material'
import React from 'react'

const footer = () => {
  return (
    <Grid container sx={{p:4, backgroundColor:'#008B8B'}}>
      <Grid item xs={12} md={3} sx={{display:'flex', alignItems:"center", fontFamily:''}}>
        <Typography>This is my footer</Typography>
      </Grid>
    </Grid>
  )
}

export default footer
